import React from "react";
import { Container, Row, Column } from "react-bootstrap";

function Projects() {
  return (
    <div>
      <Container>
        <Row>
          <Column>
            <div className="card text-center"></div>
          </Column>
          <Column>There</Column>
        </Row>
      </Container>
    </div>
  );
}

export default Projects;
